function [f,g]=funk1(x)

w=[1 4 4 1 1 zeros(1,8)];

f=w*x';

g(1)=(x(1)+x(3))*x(6)+x(3)*x(7);
g(2)=x(3)*x(6)+(x(5)+x(3))*x(7)-x(5)*x(9)-1;
