g(4)=-x(5)*x(7)-x(2)*x(8)+(x(5)+x(2))*x(9);
g(5)=(x(1)+x(3))*x(10)+x(3)*x(11);
g(6)=x(3)*x(10)+(x(5)+x(3))*x(11)-x(5)*x(13);
g(7)=(x(4)+x(2))*x(12)-x(2)*x(13);
g(8)=-x(5)*x(11)-x(2)*x(12)+(x(5)+x(2))*x(13)+1;
g(9)=x(7)-1;
g(10)=-x(13)-1;


