function [f,g]=funk3(x)

global u v

w=[1 4 4 1 1];
f=w*x';

p=[0 1 0 0]';
q=[0 0 0 -1]';

K=[(x(1)+x(3)) x(3) 0 0
   
   x(3) (x(5)+x(3)) 0 -x(5)
   
   0 0 (x(4)+x(2)) -x(2)
   
   0 -x(5) -x(2) (x(5)+x(2))];

u=K\p;
v=K\q;

g(1)=p'*u-1;
g(2)=q'*v-1;


